import './App.css';
import { Navbar } from './Components/Navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom'; // Correctly imported BrowserRouter
import { ShopCategory } from './Pages/ShopCategory';
import { LoginSignup } from './Pages/LoginSignup';
import { Cart } from './Pages/Cart';
import { Product } from './Pages/Product';
import { Shop } from './Pages/Shop';



function App() {
  return (
    <div>
      <BrowserRouter> {/* Wrap the entire application */}
        <Navbar />
        <Routes>
          <Route path='/' element={<Shop />} />
          <Route path='/mens' element={<ShopCategory category="mens" />} />
          <Route path='/womens' element={<ShopCategory category="womens" />} /> {/* Fixed typo here */}
          <Route path='/kids' element={<ShopCategory category="kids" />} />
          <Route path='/product/:productId' element={<Product />} /> {/* Fixed product route */}
          <Route path='/cart' element={<Cart />} />
          <Route path='/login' element={<LoginSignup />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
